function waveTimes(XTX){
	var element = document.getElementById("TimeBar");

	var MaxL = curPos.length - 1;

	}while(cnt < MaxL - 1);

function countTimeUp(XT){
	var DiffBon = 4;
	if(MonsCode == 0){
		spawnSpeed = 1700;
		DiffBon = 4;
	}
	if(MonsCode == 1){
		spawnSpeed = 2700;
		DiffBon = 4;
	}
	if(MonsCode == 2){
		spawnSpeed = 2700;
		DiffBon = 8;
	}
	if(MonsCode == 3){
		spawnSpeed = 2400;
		DiffBon = 8;
	}
	if(MonsCode == 4){
		spawnSpeed = 2000;
		DiffBon = 8;
	}
	if(XT >= 900 && XT < 1000){
		clearInterval(currWave);
		if(doSpawn == 1){createMons(MonsCode, Math.round(miniWin/3) + waveDiff);}
		currWave = setInterval(function(){if(doSpawn == 1){createMons(MonsCode, Math.round(miniWin/3) + waveDiff);} console.log("TICK"); return; },spawnSpeed);
		document.getElementById("TimeBar").style.width = 10;
		waveDiff = waveDiff + DiffBon;
	}
	resetWalls();
	resetCaltrops();
	waveTimes(XT);
}

function modMonsBar(BarID, MaxHit, CurHit){ 
	var curBarSize = 0;
	element = document.getElementById(BarID);
	var style = getComputedStyle(element);
	curBarSize = style.top;
	
	var MaxL = curBarSize.length - 1;
	var newBarSize = '';
	var cnt = 0;
	do{
		newBarSize = newBarSize.concat(curBarSize[cnt]);
		//console.log(newPnt)
		cnt = cnt + 1;
	}while(cnt < MaxL - 1);
	curBarSize = parseInt(curBarSize);
	
	var TopPos = curBarSize;
	
	var BarCalc = (CurHit/MaxHit)+ .03;
	
	if(BarCalc < .08){
		curBarSize = 2;
		TopPos = 300 + (96 - curBarSize);
	} else {
		curBarSize = (96 * BarCalc);
		TopPos = 300 + (96 - curBarSize);
	}
	element.style.top = TopPos;
	element.style.height = curBarSize;
	console.log(BarID, curBarSize, TopPos);
	return;
}

function gameWaveTimer(gameTime){
	if(gameTime >= 900 && gameTime < 1000){
		gameTime = 10;
		document.getElementById("TimeBar").style.width =  10;
		if(isGameWave == 1){
			completeWave();
		}
	}
	setTimeout(function(){gameWaveTimerTick(gameTime);},250);
}
function gameWaveTimerTick(gTime){
	var element = document.getElementById("TimeBar");
	var styler = getComputedStyle(element);
	var curPos = 0;
	curPos = styler.width;
	var MaxL = curPos.length - 1;
	var newPnt = '';
	var cnt = 0;
	do{
		newPnt = newPnt.concat(curPos[cnt]);
		//console.log(newPnt)
		cnt = cnt + 1;
	}while(cnt < MaxL - 1);
	newPnt = parseInt(newPnt);
	var pntGain = 0;
	if(doSpawn == 0){pntGain = 0;}
	if(doSpawn == 1){pntGain = 10;}
	newPnt = newPnt + pntGain;
	gTime = newPnt;
	document.getElementById("TimeBar").style.width = newPnt;
	buildStats();
	
	gameWaveTimer(gTime);
	return;
}
